      <a>{props.title}</a>
      <br></br>
    </Link>
//   {/* </li> */}
);

export default () => (
    <Layout>
        <div>
            <h1>INDEX.JS</h1>
            <hr></hr>
            {/* <ul> */}
                <PostLink id='country1' title='Greece' />
                <PostLink id='country2' title='South Africa' />
                <PostLink id='country3' title='The UK' />
            {/* </ul> */}
        </div>
    </Layout>
);
